import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './card.js';
import Carlist from './cardlist.js'
/*import {robots} from './robots.js';*/
import * as serviceWorker from './serviceWorker';
import 'tachyons';
ReactDOM.render(
  <React.StrictMode>
    	<div className='tc'>
    	<Card id={'1'} name={'Leanne Graham'} username={'Bret'} email={'Sincere@april.biz'} />
    	<Card id={'2'} name={'Ervin Howell'} username={'Antonette'} email={'Shanna@melissa.tv'} />
    	<Card id={'3'} name={'Clementine Bauch'} username={'Samantha'} email={'Nathan@yesenia.net'} />
    	<Card id={'4'} name={'Patricia Lebsack'} username={'Karianne'} email={'Julianne.OConner@kory.org'} />
    	<Card id={'5'} name={'Chelsey Dietrich'} username={'Kamren'} email={'Lucio_Hettinger@annie.ca'} />
    	<Card id={'6'} name={'Mrs. Dennis Schulist'} username={'Leopoldo_Corkery'} email={'Karley_Dach@jasper.info'} />
    	<Card id={'7'} name={'Kurtis Weissnat'} username={'Elwyn.Skiles'} email={'Telly.Hoeger@billy.biz'} />
    	<Card id={'8'} name={'Nicholas Runolfsdottir V'} username={'Maxime_Nienow'} email={'Sherwood@rosamond.me'} />
    	<Card id={'9'} name={'Glenna Reichert'} username={'Delphine'} email={'Chaim_McDermott@dana.io'} />
    	<Card id={'10'} name={'Clementina DuBuque'} username={'Moriah.Stanton'} email={'Rey.Padberg@karina.biz'} />
    	</div>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
